    false,nt"url": null,nt"notes": "This Inventory and Monitoring Plan (IMP)
    documents the inventory and monitoring surveys that will or could be conducted at
    Dahomey NWR from 2015 through 2030, or until the refuge Comprehensive Conservation
    Plan (CCP), Habitat Management Plan or this IMP is revised. The majority of prioritized
    surveys considered in this plan address resource management objectives identified
    in the 2013 Dahomey NWR HMP.  The surveys specifically address resources of concern.
     Following the IMP development process, 13 surveys were selected to be conducted
    currently.  Seven additional surveys will be addressed if ancipated capacity is
    allocated (funding and FTE).  The plan also contains initial survey instructions
    for both the 13 current and 7 expected surveys to be conducted during the time span
    of this plan.  The initial survey instructions serve as an interim process until
    specific protocols can be completed for each of the surveys.",nt"license_title":
